import React, {Component} from 'react'
const TableHeader = () => {
    return (
        <thead>
            <tr>
                <th>Name</th>
                <th>Job</th>
            </tr>
        </thead>
    )
}
const TableBody = () => {
    return (
           <tbody>
                <tr>
                    <td>Charlie</td>
                    <td>Todd</td>
                </tr>
                <tr>
                    <td>Mac</td>
                    <td>Bouncer</td>
                </tr>
                <tr>
                    <td>Dee</td>
                    <td>Aspring actresss</td>
                </tr>
                <tr>
                    <td>Artee</td>
                    <td>Parss</td>
                </tr>
            </tbody>        
    )
}
class Table extends Component {
    render() {
        return (
            <table>
                <TableHeader/>
                <TableBody/>
            </table>
        )
    }
}

export default Table
